import React from 'react';
import TaskCard from './TaskCard';

const Table = props =>{
const taskList = props.tasks.map(element => <TaskCard tasks={element} key={element.id}/>)
  return (
    <table>
    <thead>
      <tr>
        <th> Task </th>
        <th> Status </th>
        <th> Due By </th>
      </tr>
    </thead>
    <tbody>
      {taskList}
    </tbody>
  </table>
  )
}

export default Table;
